import React from "react";
import { Row, Col } from "react-bootstrap";
import Products from "./products";

const HomeScreen = () => {
  return (
    <div>
      <h1>Products List</h1>
      {Products.map((product) => (
        <Col sm={3} md={4} lg={6} xl={12}>
          <h3>{product.name}</h3>
        </Col>
      ))}
    </div>
  );
};

export default HomeScreen;
